message:
🚨 Confira curiosidades de Gabriel Santana, 23 anos, integrante do Camarote!

- É extremamente preguiçoso;

- Gosta de jogar RPG de mesa;

- Se tornou conhecido ao interpretar o Mosca no remake de “Chiquititas”;

- Escreve poesias e deseja ser roteirista;

- Na adolescência, namorou com a influenciadora digital Nicole Tulcheski;

- Bissexual, está solteiro;

- Desde que os pais se separaram, dorme na cama da mãe com ela;

- Seu último trabalho na TV foi como Renato, filho de Tenório (Murilo Benício), em “Pantanal”;

- Festeiro, nunca bebe um dia antes do trabalho;

- Estrelou uma série ao lado do youtuber Rezende;

- Adora café da manhã na cama.
